const ScreenShot = ({index, src, alt, caption}) => (
    <div key={`${index}_${src}`}>
        <p>screenshot</p>
        <img
            src={src}
            alt={alt}
        />
        <p>{caption}</p>
    </div>
);

export default ScreenShot;
